        "share_text": "What you call this FRUIT in ur area?\u00f0\u009f\u00a4\u0094 Seema Chintakaya, Gubbalu, Jungle Jalebi, Kodukkapuli #reels\n\nSeema Chintakaya | Manila Tamarind | Gubba Kayalu | Gubbalu | Jungle Jalebi Fruit | Ganga Imli | Ganga Tamarind | Kodukkapuli | Seema Hunase | Madras Thorn Fruit | Monkey Pod | Camachile | Puli Chintakaya | Cheema Chintakaya | Sisindri Kayalu | Seema Tumma Kayalu | Pithecellobium Dulce Bean | Indian Summer Fruits | Indian Traditional Food | Chetana Foods\n----\n\n\u00e2\u0098\u0085\u00e2\u0098\u0085 IMPORTANT \u00e2\u0098\u0085\u00e2\u0098\u0085 Please SUBSCRIBE to 'ChetanaFoods' Channel on YouTube & Instagram.\n\nThanks Everyone for Your Support !\nWith Love \u00e2\u009d\u00a4\u00ef\u00b8\u008f ChetanaFoods\n----\n\n\u00e2\u0098\u0085\u00e2\u0098\u0085 Hi all... We request you to always try to buy fruits & vegetables from local vendors & poor farmers, and support them as much as possible. Thanks \u00f0\u009f\u0099\u008f\n----\n\nManila Tamarind - Useful Information:\nIt is referred to as 'Seema Chintakaya' in Telugu, 'Kodukka Puli' in Tamil, 'Seema Hunase' in Kannada, while other English names include Manila Tamarind, Madras Thorn, Monkey Pod and Camachile. In botany, the scientific terminology is Pithecellobium dulce.\n\nSeema Chintakaya is a fruit which is similar to tamarind / chintakaya but its pulp tastes sweet and looks twisted and red in colour and that's why this fruit is called Seema Chintakaya. These trees are grown on streets in India and its also found grown in South America, Mexico, Philippines, Bengal, Caribbean, Florida and other places. Seema Chintakaya fruits are also called as Monkey pod.\n\nManila Tamarind - Benefits :\n\u00e2\u0080\u00a2 This fruit is used in preparing many sweat dishes & desserts and mainly consumed raw.\n\u00e2\u0080\u00a2 The fruit is said to have good reducing weight properties.\n\u00e2\u0080\u00a2 Its also helpful in strengthening the gums of tooth and preparing medicines.\n\u00e2\u0080\u00a2 The fruit extract helps in curing diarrhea, tuberculosis and dysentery.\n----\n\n#seemachintakaya #manilatamarind #gubbalu #kodukkapuli #junglejalebi #monkeypod #madrasthorn",
