        "share_text": "Day 5 - Solo Trip in Meghalaya, I went to whistling village of India - Kongthong Village -\n\nWhat is unique about this village?\nPeople do not call each other by their regular names but by a distinct melody or special tune, which is why the area is known as \u00e2\u0080\u0098Whistling Village\u00e2\u0080\u0099. \n\nThe villagers of Kongthong have called this tune \u00e2\u0080\u0098Jingrwai Lawbei\u00e2\u0080\u0099, which means mother\u00e2\u0080\u0099s love song.\n\nA local villager told me - If any villager dies, then the tune of that person will also die along with him or her. We have our own tunes and the mother composed these tunes. We have used the tunes in two ways - long tune and short tune. We have used the short tune in our village or home. My tune was composed by my mother. This system is going on in our village from generation to generation. We don\u00e2\u0080\u0099t know when it started. But, all villagers are very happy with this. \n\nPopulation is of 700, so there are 700 tunes.\n\nHow to Reach?\nIt is 53 kms from Shillong and takes 2.5 hours to reach. I rented a scooty for a day for this trip. But let me tell you, roads are bad.\n\nIs it worth it?\nYes..villagers are shy. They take time to mingle. But, once they are open up. You will have a blast with them. You can already get the vibes from my reel.\n\nFollow @analligupta for more such travel stories\n\n#analigupta #travelwithanali #kongthong #whistelingvillagemeghalaya \n@meghtourism",
